import React from "react";
import { Link } from "react-router-dom";
import Header from "components/Header";


function Home() {
  return (
    <div>
      <Header />
      <h1>Home</h1>
      <p><Link to="/services">Services</Link></p>
      <p><Link to="/contact">Contact</Link></p>
      <p><Link to="/404">NotFoundPage</Link></p>
    </div>
  );
}

export default Home;
